$(window).scroll(function (event) {
    var wrapper = $('#wrapper').height();
    var footer = $('.footer-start').innerHeight();
    var support = $('.cart-about').innerHeight();
    var windowheight = $(window).height();
    var totalfooter = footer + support;
    var ww = wrapper - windowheight;
    var main_height = ww - totalfooter;

    $(window).scrollEnd(function(){

	    if ($(this).scrollTop() < main_height) {
	        $(".secure-payment-info").addClass('fixed' , 1000);
	    } else {
	        $(".secure-payment-info").removeClass('fixed' , 1000);
	    }
	}, 100);
});
$.fn.scrollEnd = function(callback, timeout) {          
  $(this).scroll(function(){
    var $this = $(this);
    if ($this.data('scrollTimeout')) {
      clearTimeout($this.data('scrollTimeout'));
    }
    $this.data('scrollTimeout', setTimeout(callback,timeout));
  });
};

